import React from "react";
import { View, Text, Image, TextInput, TouchableOpacity } from "react-native";
import { AntDesign } from "@expo/vector-icons";

export default function Getstarted(params) {
  const navigation = params.navigation;
  return (
    <View
      style={{
        backgroundColor: "violet",
        flex: 1,
        resizeMode: "cover",
        width: " 100%",
        height: "100%",
      }}
    >
      <Image
        style={{
          transform: [{ rotate: "0deg" }],
          borderRadius: 20,
          marginBottom: 60,
          width: 350,
          height: 350,
        }}
        source={require("../images/thread.png")}
      />
      <Text style={{ fontSize: 30, color: "grey" }}>WELCOME TO</Text>
      <Text style={{ fontSize: 40, fontWeight: "bold" }}>THE THREAD STORE</Text>

      <TouchableOpacity
        onPress={() => {
          navigation.navigate("Login");
        }}
        style={{
          padding: 15,
          paddingHorizontal: 80,
          marginTop: 15,
          alignItems: "center",
          borderRadius: 10,
          flexDirection: "row",
          backgroundColor: "black",
        }}
      >
        <AntDesign name="apple1" size={24} color="white" />
        <Text style={{ paddingLeft: 10, color: "white" }}>Get Started</Text>
      </TouchableOpacity>
    </View>
  );
}
